section_1_title = 'A. Asuinalueiden elinvoimaisuus'

section_1_main_image = {
    'filename': 'images/asuminen/section_1/main_image.png',
    'caption': 'Asuinalueiden elinvoimaisuus.'
}

section_1_lead = '''

'''

section_1_body = '''
<p>Edistetään kestävää kaupunkikehitystä tiedostaen alueiden erilaisuus ja eriytymiskehitys.
</p>
<p>Keskeisimmät aluerakentamiskohteet seuraavina vuosina ovat Länsisatama, Kalasatama, Pasila, Kruunuvuorenranta, Kuninkaantammi ja Honkasuo. Tulevan asuntotuotannon näkökulmasta suunnittelun etenemistä edistetään Malmin lentokentän, Koivusaaren ja Östersundomin alueilla. Näiden alueiden osuus asuntotuotannosta on noin 60 prosenttia.
</p>
<p>Asuntorakentamisesta 40 prosenttia toteutuu täydennysrakentamisena. Tuotantotavoitteen turvaamiseksi täydennysrakentamisen koordinaatiota vahvistetaan sekä kehitetään prosesseja ja kannusteita.
</p>
<p>Asuntotuotantotavoitteen toteuttamiseksi tulee huolehtia riittävästä eri puolilla kaupunkia olevasta asemakaavavarannosta sekä varmistaa tonttien rakentamisedellytykset. Täydennysrakentamisalueen asemakaavoitusta ohjelmoidaan nykyistä järjestelmällisemmin.
</p>
<p>Alueilla, joiden asuntokanta on yksipuolista ja uudistuotanto vähäistä, uusi asuntokantaa monipuolistava täydennysrakentaminen on tärkein tavoite.
</p>
<p>Jatketaan autopaikattomien ja vähäautopaikkaisten asuntokohteiden toteuttamista erityisesti hyvien joukkoliikenneyhteyksien läheisyydessä.
</p>

'''

# section 2
# -------------

section_2_title = 'B. Asuntokannan ja asuntorakentamisen kehittäminen'

section_2_main_image = {
    'filename': 'images/asuminen/section_2/main_image.png',
    'caption': 'Asuntokannan ja asuntorakentamisen kehittäminen.'
}

section_2_lead = '''

'''

section_2_body = '''
<p>Jatketaan monimuotoisen kerrostaloasumisen kehittämistä: lisätään vanhan rakennuskannan uusiokäyttöä, ullakko- ja lisäkerrosrakentamista sekä mahdollistetaan seka- ja hybriditalojen rakentaminen.
</p>
<p>Kaupungin toimin edistetään hissien rakentamista vanhaan asuntokantaan.
</p>
<p>Edistetään omatoimista rakentamista ja rakennuttamista, kaupunkimaisten pientalojen rakennuttamista sekä ryhmärakennuttamista.
</p>
<p>Edistetään uusiutuvien ja ympäristöä mahdollisimman vähän kuormittavien rakennusmateriaalien ja tuotantotapojen käyttöä sekä mahdollistetaan kiinteistökohtaisten energialähteiden käyttöönotto.
</p>
'''

# section 3
# -------------

section_3_title = 'C. Asukasrakenteen monipuolisuus'

section_3_main_image = {
    'filename': 'images/asuminen/section_3/main_image.png',
    'caption': 'Asukasrakenteen monipuolisuus.'
}

section_3_lead = '''

'''

section_3_body = '''
<p>Lapsiperheille sopivia asuntoja rakennetaan riittävästi uusille alueille sekä täydennysrakentamiskohteisiin. Huoneistotyyppiohjauksella varmistetaan perheasuntojen rakentaminen.
</p>
<p>Lisätään asuntomarkkinoille tulevien nuorten sekä yksinasuvien kaupunkilaisten kohtuuhintaisen vuokra-asumisen tarjontaa.
</p>
<p>Ikäihmisille kohdennettuja asumisvaihtoehtoja toteutetaan kaikkiin hallinta- ja rahoitusmuotoihin. Esteettömiä asumisvaihtoehtoja lisätään täydennysrakentamisalueilla.
</p>
<p>Vieraskielisen väestön asumisen tukemiseksi kehitetään edelleen asumisneuvontaa ja parannetaan eri asumisvaihtoehdoista tiedottamista.
</p>
<p>Huolehditaan riittävästä vanhusten, kehitysvammaisten, päihde- ja mielenterveyskuntoutujien ja asunnottomien asuntotuotannosta.
</p>
'''

